import { useState } from "react";
import Gallery from "./Gallery";
import { Profile } from "./Gallery";

function Square({ value, onSquareClick }) {

    return <button className="square" onClick={onSquareClick}>
        {value}
    </button>;
}

export default function App() {

    return (
        <>
        <Profile />
        <Gallery />
        </>
    );
}
